  render() {
    return (
      <Html lang="en">
        <Head>
          {/* Plausible Analytics script */}
          <script
            async
            defer
            data-domain={`hirejuniors.dev`}
            src={`https://plausible.harshil.dev/js/plausible.js`}
          />
        </Head>
        <body>
          <Main />
          <NextScript />
        </body>
      </Html>
    );
  }
}
